--
-- Base de datos: `inventory_management`
--
CREATE DATABASE gattidev_db;
USE gattidev_db;

-- --------------------------------------------------------

DELIMITER $$
--
-- Procedimientos
--
CREATE PROCEDURE `SP_Delete_Administrator` (`data1` INT)   
  DELETE FROM `administrator` WHERE `id_setting` = data1$$

CREATE PROCEDURE `SP_Delete_Image` (`data1` INT)   
  DELETE FROM `image` WHERE `id` = data1$$

CREATE PROCEDURE `SP_Delete_Setting` (`data1` INT)   
  DELETE FROM `setting` WHERE `id` = data1$$

CREATE PROCEDURE `SP_Get_Administrator` (IN `data1` VARCHAR(255))   
  SELECT * FROM `administrator` WHERE `name` = data1$$

CREATE PROCEDURE `SP_Get_Image` (`data1` VARCHAR(50), `data2` INT)   
  SELECT * FROM `image` WHERE `title` = data1 AND `id_destiny` = data2$$

CREATE PROCEDURE `SP_Get_ProcessBar` (`data1` INT)   
  SELECT * FROM `process_bar` WHERE `id` = data1$$

CREATE PROCEDURE `SP_Get_Setting` (`data1` INT)   
  SELECT * FROM `setting` WHERE `id` = data1$$

CREATE PROCEDURE `SP_Put_Administrator` (`data1` INT, `data2` VARCHAR(255), `data3` VARCHAR(45), `data4` VARCHAR(255), `data5` VARCHAR(255), `data6` DATE)   
  INSERT INTO `administrator`(`id`, `id_setting`, `name`, `password`, `encryption`, `lincense`, `date`) VALUES (null, data1, data2, data3, data4, data5, data6)$$

CREATE PROCEDURE `SP_Put_Image` (`data1` VARCHAR(50), `data2` VARCHAR(255), `data3` TEXT, `data4` LONGBLOB, `data5` TEXT, `data6` VARCHAR(255), `data7` DATE, `data8` INT)   
  INSERT INTO `image`(`id`, `title`, `description`, `archive`, `image`, `type`, `link`, `date`, `id_destiny`) VALUES (null, data1, data2, data3, data4, data5, data6, data7, data8)$$

CREATE PROCEDURE `SP_Put_processBar` (`data1` INT)   
  UPDATE `process_bar` SET `executed`= 0, `total`= data1, `percentage`= 0, `execute_time`= '', `date_add`= now(), `date_upd`= '0000-00-00 00:00:00' WHERE `id`= 1$$

CREATE PROCEDURE `SP_Put_Setting` (IN `data1` VARCHAR(255), IN `data2` VARCHAR(255), IN `data3` DATE)   
  INSERT INTO `setting`(`id`, `administrator`, `lincense`, `date`) VALUES (null, data1, data2, data3)$$

CREATE PROCEDURE `SP_Run_Administrator` ()  
  SELECT * FROM `administrator`$$

CREATE PROCEDURE `SP_Run_image` ()   
  SELECT * FROM `image`$$

CREATE PROCEDURE `SP_Run_Setting` ()   
  SELECT * FROM `setting`$$

CREATE PROCEDURE `SP_Update_Administrator` (`data1` INT, `data2` VARCHAR(255), `data3` DATE)   
  UPDATE `administrator` SET `lincense`= data2,`date`= data3 WHERE `id_setting`= data1$$

CREATE PROCEDURE `SP_Update_ProcessBar` (`data1` INT, `data2` INT)   
  UPDATE `process_bar` SET `executed`= executed + data2 WHERE `id`= data1$$

CREATE PROCEDURE `SP_Update_Process_Bar` (`data1` FLOAT, `data2` VARCHAR(128))  
  UPDATE `process_bar` SET `percentage`= data1, `execute_time`= data2 WHERE `id`= 1$$

CREATE PROCEDURE `SP_Update_Setting` (`data1` INT, `data2` VARCHAR(255), `data3` DATE) 
  UPDATE `setting` SET `lincense`= data2,`date`= data3 WHERE `id`= data1$$

DELIMITER ;

-- --------------------------------------------------------
--
-- Estructura de tabla para la tabla `setting`
--
create table setting(
	id 			int auto_increment not null,
    administrator        varchar(255),
    lincense		varchar(255) not null,
    date	    date not null,
    constraint pk_setting primary key(id),
    constraint uq_administrator unique(administrator)
) engine = InnoDB;

