--
-- Estructura de tabla para la tabla `administrator`
--
create table administrator(
    id          int auto_increment not null,
    id_setting  int not null,
    name        varchar(255) not null,
    password    varchar(45) not null,
    encryption  varchar(255) not null,
    lincense     varchar(255) not null,
    date        date not null,
    constraint pk_administrator primary key(id),
    constraint fk_administrator_setting foreign key(id_setting) references setting(id),
    constraint uq_password unique(password),
    constraint uq_encryption unique(encryption),
    constraint uq_name unique(name)
) engine = InnoDB;

